import React from 'react';
import produtos from '../../data/produtos';

export default (props) => {
  const listaprod = produtos.map((produto) =>{
    return(
    <li>
      {produto.id} {produto.nome} {produto.preco}
    </li>
    )
  })


  return (
    <div>
      <tr>
        <th>ID</th>
        <th>PRODUTO</th>
        <th>PREÇO</th>
      </tr>
      <tr>
        <td>1</td>
        <td>2</td>
        <td>s</td>
      </tr>


    </div>
  );
};
